import React from 'react';

const Tagline = () => {
    return (
        <>
            <section class="text-white d-flex">
                <div class="sec1">
                    <h1>Build for enterprise businesses.</h1>
                    <p>Opus includes everything you need to build a beautiful website for your business. Built to perform and look good doing so.</p>
                    <button className="btn btn-outline-primary text-white bg-primary">Learn More {'->'} </button>
                    <p>Explore Pages</p>
                </div>
                <div class="bg-primary sec2"></div>
            </section>
        </>
    );
};

export default Tagline;
